import React from 'react';
import { HashLink as Link } from 'react-router-hash-link';
import { Container, Row, Col } from 'reactstrap';

const HeaderBanner2 = () => {
    return (
        <div className="static-slider-head banner2">
            <Container>
                <Row className="justify-content-center">
                    <Col lg="8" md="6" className="align-self-center text-center">
                        <h1 className="title">ECOBOOKING</h1>
                        <h4 className="subtitle font-light">TE ANIMAMOS A ELEGIR UN LUGAR PERFECTO PARA TI<br /> "Acogedor y Natural"</h4>
                        <div className="button-container">
                            <a href="https://wrappixel.com/templates/wrapkit-react-lite/" className="btn btn-success-gradiant font-14">Alojamientos</a>
                            <Link to="/#coming" className="btn btn-success-gradiant font-14">Atracciones Ecoturisticas</Link>
                        </div>
                    </Col>
                </Row>
            </Container>
        </div>
    );
}

export default HeaderBanner2;
